import React from "react";
import "./Numeros.css";

function Numeros() {

    const setNumber = (num) => {
        alert("Oprimi el "+num);
    }


    return (
        <div className="contain-button">
            <div><button 
            onClick={() => {setNumber(this.value)}}
            
            >1
            
            </button></div>
            <div><button 
             
            onClick={() => {setNumber(this.value)}}
            
            >2
            
            </button></div>
            <div><button 
             
            onClick={() => {setNumber(this.value)}}
            
            >3
            
            </button></div>
            <div><button 
             
            onClick={() => {setNumber(this.value)}}
            
            >4
            
            </button></div>
            <div><button 
             
            onClick={() => {setNumber(this.value)}}
            
            >5
            
            </button></div>
            <div><button 
             
            onClick={() => {setNumber(this.value)}}
            
            >6
            
            </button></div>
            <div><button 
             
            onClick={() => {setNumber(this.value)}}
            
            >7
            
            </button></div>
            <div><button 
             
            onClick={() => {setNumber(this.value)}}
            
            >8
            
            </button></div>
            <div><button 
             
            onClick={() => {setNumber(this.value)}}
            
            >9
            
            </button></div>
            <div></div>
            <div><button>0</button></div>
            <div></div>
        </div>
    );
}

export { Numeros };
